import React from 'react';

export default function Hero(){
    return(
        <div className = "photo-container">
            <img className = "photo-container-image-1" alt = "Gathering" src = "https://www.traveldailymedia.com/assets/2019/11/airbnb-experiences-cooking.jpg"></img>
            <img className = "photo-container-image-2" alt = "Cooking" src = "https://remthailand.asia/wp-content/uploads/2019/12/Ancient-Cooking-Customs-of-Mexico-1_m.jpg"></img>
            <img className = "photo-container-image-3" alt = "Violin and Guitar" src = "https://news.airbnb.com/wp-content/uploads/sites/4/2020/04/673724_Airbnb_00006-2.jpg?fit=2500%2C1406"></img>
            <img className = "photo-container-image-4" alt = "Piano" src = "https://images.squarespace-cdn.com/content/v1/59050b54b3db2ba7eafde083/1504813681228-RW7HV9GECP2PR2OK1MVN/Mexico+Condesa+Aparment-3.jpg?format=1000w"></img>
            <img className = "photo-container-image-5" alt = "Swimming" src = "https://www.narcity.com/media-library/image.jpg?id=25922412&width=1245&quality=85&coordinates=0%2C284%2C0%2C284&height=700"></img>
            <img className = "photo-container-image-6" alt = "Meditation" src = "https://mkt-assets.trutrip.co/wp-content/uploads/2021/04/14105904/woman-meditation-1024x682.jpg.webp"></img>
            <img className = "photo-container-image-7" alt = "Singin" src = "https://news.airbnb.com/wp-content/uploads/sites/4/2021/05/1-1.jpg?resize=1200%2C1600"></img>
        </div>
    )
}
